import React, {Component} from 'react';
import 'datatables.net-dt/css/jquery.dataTables.css'


const $ = require('jquery');

$.DataTable = require('datatables.net');



export class Table extends Component {
  constructor(props){
    super(props)
  }

  componentDidMount() {

  } 

  componentWillUnmount(){

  }




  render(){


    return (
      <div>
        <table id="example" class="display">
        <thead>
            <tr>
                <th>Name</th>
                <th>Position</th>
                <th>Office</th>
                <th>Age</th>
                <th>Start date</th>
                <th>Salary</th>
            </tr>
        </thead>
        <tfoot>
            <tr>
                <th>Name</th>
                <th>Position</th>
                <th>Office</th>
                <th>Age</th>
                <th>Start date</th>
                <th>Salary</th>
            </tr>
        </tfoot>
    </table>
    </div>
    )
  }
}
